SET FOREIGN_KEY_CHECKS=0;

CREATE DATABASE IF NOT EXISTS fichapostulantes;

USE fichapostulantes;

DROP TABLE IF EXISTS apoderado;

CREATE TABLE `apoderado` (
  `idApoderado` int(11) NOT NULL AUTO_INCREMENT,
  `DNI` int(11) DEFAULT NULL,
  `apePaterno` varchar(20) DEFAULT NULL,
  `apeMaterno` varchar(20) DEFAULT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  `nacionalidad` varchar(20) DEFAULT NULL,
  `religion` varchar(20) DEFAULT NULL,
  `fechaNac` date DEFAULT NULL,
  `telefono` int(11) DEFAULT NULL,
  `celular` int(11) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `lugarTrabajo` varchar(30) DEFAULT NULL,
  `ingresoMensual` int(11) DEFAULT NULL,
  `funcionRealiza` varchar(100) DEFAULT NULL,
  `desAdicional` varchar(100) DEFAULT NULL,
  `idEstadoCivil` int(11) DEFAULT NULL,
  `idGradoIns` int(11) DEFAULT NULL,
  `idConLaboral` int(11) DEFAULT NULL,
  PRIMARY KEY (`idApoderado`),
  KEY `idEstadoCivil` (`idEstadoCivil`),
  KEY `idGradoIns` (`idGradoIns`),
  KEY `idConLaboral` (`idConLaboral`),
  CONSTRAINT `apoderado_ibfk_1` FOREIGN KEY (`idEstadoCivil`) REFERENCES `estadocivil` (`idEstadoCivil`),
  CONSTRAINT `apoderado_ibfk_2` FOREIGN KEY (`idGradoIns`) REFERENCES `gradodeinstruccion` (`idGradoIns`),
  CONSTRAINT `apoderado_ibfk_3` FOREIGN KEY (`idConLaboral`) REFERENCES `condicionlaboral` (`idConLaboral`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS condicionlaboral;

CREATE TABLE `condicionlaboral` (
  `idConLaboral` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idConLaboral`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS conforma;

CREATE TABLE `conforma` (
  `idConforma` int(11) NOT NULL,
  `idGrado` int(11) DEFAULT NULL,
  `idNivel` int(11) DEFAULT NULL,
  PRIMARY KEY (`idConforma`),
  KEY `idGrado` (`idGrado`),
  KEY `idNivel` (`idNivel`),
  CONSTRAINT `conforma_ibfk_1` FOREIGN KEY (`idGrado`) REFERENCES `grado` (`idGrado`),
  CONSTRAINT `conforma_ibfk_2` FOREIGN KEY (`idNivel`) REFERENCES `nivel` (`idNivel`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS departamento;

CREATE TABLE `departamento` (
  `idDepartamento` int(11) NOT NULL,
  `nombre` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`idDepartamento`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS distrito;

CREATE TABLE `distrito` (
  `idDistrito` int(11) NOT NULL,
  `nombre` varchar(50) DEFAULT NULL,
  `idProvincia` int(11) DEFAULT NULL,
  PRIMARY KEY (`idDistrito`),
  KEY `idProvincia` (`idProvincia`),
  CONSTRAINT `distrito_ibfk_1` FOREIGN KEY (`idProvincia`) REFERENCES `provincia` (`idProvincia`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS estadocivil;

CREATE TABLE `estadocivil` (
  `idEstadoCivil` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idEstadoCivil`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS grado;

CREATE TABLE `grado` (
  `idGrado` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idGrado`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS gradodeinstruccion;

CREATE TABLE `gradodeinstruccion` (
  `idGradoIns` int(11) NOT NULL,
  `nombre` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`idGradoIns`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS hermano;

CREATE TABLE `hermano` (
  `idHermano` int(11) NOT NULL AUTO_INCREMENT,
  `DNI` int(11) DEFAULT NULL,
  `apePaterno` varchar(20) DEFAULT NULL,
  `apeMaterno` varchar(20) DEFAULT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  `seccion` varchar(1) DEFAULT NULL,
  `idConforma` int(11) DEFAULT NULL,
  PRIMARY KEY (`idHermano`),
  KEY `idConforma` (`idConforma`),
  CONSTRAINT `hermano_ibfk_1` FOREIGN KEY (`idConforma`) REFERENCES `conforma` (`idConforma`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS nivel;

CREATE TABLE `nivel` (
  `idNivel` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idNivel`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS posee;

CREATE TABLE `posee` (
  `idPosee` int(11) NOT NULL AUTO_INCREMENT,
  `idPostulante` int(11) DEFAULT NULL,
  `idProgenitor` int(11) DEFAULT NULL,
  PRIMARY KEY (`idPosee`),
  KEY `idPostulante` (`idPostulante`),
  KEY `idProgenitor` (`idProgenitor`),
  CONSTRAINT `posee_ibfk_1` FOREIGN KEY (`idPostulante`) REFERENCES `postulante` (`idPostulante`),
  CONSTRAINT `posee_ibfk_2` FOREIGN KEY (`idProgenitor`) REFERENCES `progenitor` (`idProgenitor`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS postulante;

CREATE TABLE `postulante` (
  `idPostulante` int(11) NOT NULL AUTO_INCREMENT,
  `DNI` int(11) DEFAULT NULL,
  `apePaterno` varchar(20) DEFAULT NULL,
  `apeMaterno` varchar(20) DEFAULT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  `sexo` varchar(10) DEFAULT NULL,
  `religion` varchar(20) DEFAULT NULL,
  `fechaNac` date DEFAULT NULL,
  `numHijo` int(11) DEFAULT NULL,
  `numOcupa` int(11) DEFAULT NULL,
  `numHermanos` int(11) DEFAULT NULL,
  `direccion` varchar(50) DEFAULT NULL,
  `IEprocedencia` varchar(100) DEFAULT NULL,
  `desAdicional` varchar(100) DEFAULT NULL,
  `idDistrito` int(11) DEFAULT NULL,
  `idConforma` int(11) DEFAULT NULL,
  `idTipoVivienda` int(11) DEFAULT NULL,
  `idTipoResponsable` int(11) DEFAULT NULL,
  `idSeguroMedico` int(11) DEFAULT NULL,
  `idApoderado` int(11) DEFAULT NULL,
  `idTipoFam` int(11) DEFAULT NULL,
  `idTipoIE` int(11) DEFAULT NULL,
  PRIMARY KEY (`idPostulante`),
  KEY `idDistrito` (`idDistrito`),
  KEY `idConforma` (`idConforma`),
  KEY `idTipoVivienda` (`idTipoVivienda`),
  KEY `idTipoResponsable` (`idTipoResponsable`),
  KEY `idSeguroMedico` (`idSeguroMedico`),
  KEY `idApoderado` (`idApoderado`),
  KEY `idTipoFam` (`idTipoFam`),
  KEY `idTipoIE` (`idTipoIE`),
  CONSTRAINT `postulante_ibfk_1` FOREIGN KEY (`idDistrito`) REFERENCES `distrito` (`idDistrito`),
  CONSTRAINT `postulante_ibfk_2` FOREIGN KEY (`idConforma`) REFERENCES `conforma` (`idConforma`),
  CONSTRAINT `postulante_ibfk_3` FOREIGN KEY (`idTipoVivienda`) REFERENCES `tipodevivienda` (`idTipoVivienda`),
  CONSTRAINT `postulante_ibfk_4` FOREIGN KEY (`idTipoResponsable`) REFERENCES `tipoderesponsable` (`idTipoResponsable`),
  CONSTRAINT `postulante_ibfk_5` FOREIGN KEY (`idSeguroMedico`) REFERENCES `seguromedico` (`idSeguroMedico`),
  CONSTRAINT `postulante_ibfk_6` FOREIGN KEY (`idApoderado`) REFERENCES `apoderado` (`idApoderado`),
  CONSTRAINT `postulante_ibfk_7` FOREIGN KEY (`idTipoFam`) REFERENCES `tipofamilia` (`idTipoFam`),
  CONSTRAINT `postulante_ibfk_8` FOREIGN KEY (`idTipoIE`) REFERENCES `tipodeie` (`idTipoIE`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS progenitor;

CREATE TABLE `progenitor` (
  `idProgenitor` int(11) NOT NULL AUTO_INCREMENT,
  `DNI` int(11) DEFAULT NULL,
  `apePaterno` varchar(20) DEFAULT NULL,
  `apeMaterno` varchar(20) DEFAULT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  `nacionalidad` varchar(20) DEFAULT NULL,
  `religion` varchar(20) DEFAULT NULL,
  `fechaNac` date DEFAULT NULL,
  `telefono` int(11) DEFAULT NULL,
  `celular` int(11) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `lugarTrabajo` varchar(30) DEFAULT NULL,
  `ingresoMensual` int(11) DEFAULT NULL,
  `funcionRealiza` varchar(100) DEFAULT NULL,
  `desAdicional` varchar(100) DEFAULT NULL,
  `idEstadoCivil` int(11) DEFAULT NULL,
  `idGradoIns` int(11) DEFAULT NULL,
  `idConLaboral` int(11) DEFAULT NULL,
  PRIMARY KEY (`idProgenitor`),
  KEY `idEstadoCivil` (`idEstadoCivil`),
  KEY `idGradoIns` (`idGradoIns`),
  KEY `idConLaboral` (`idConLaboral`),
  CONSTRAINT `progenitor_ibfk_1` FOREIGN KEY (`idEstadoCivil`) REFERENCES `estadocivil` (`idEstadoCivil`),
  CONSTRAINT `progenitor_ibfk_2` FOREIGN KEY (`idGradoIns`) REFERENCES `gradodeinstruccion` (`idGradoIns`),
  CONSTRAINT `progenitor_ibfk_3` FOREIGN KEY (`idConLaboral`) REFERENCES `condicionlaboral` (`idConLaboral`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS provincia;

CREATE TABLE `provincia` (
  `idProvincia` int(11) NOT NULL,
  `nombre` varchar(30) DEFAULT NULL,
  `idDepartamento` int(11) DEFAULT NULL,
  PRIMARY KEY (`idProvincia`),
  KEY `idDepartamento` (`idDepartamento`),
  CONSTRAINT `provincia_ibfk_1` FOREIGN KEY (`idDepartamento`) REFERENCES `departamento` (`idDepartamento`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS seguromedico;

CREATE TABLE `seguromedico` (
  `idSeguroMedico` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idSeguroMedico`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS tiene;

CREATE TABLE `tiene` (
  `idTiene` int(11) NOT NULL AUTO_INCREMENT,
  `idPostulante` int(11) DEFAULT NULL,
  `idHermano` int(11) DEFAULT NULL,
  PRIMARY KEY (`idTiene`),
  KEY `idPostulante` (`idPostulante`),
  KEY `idHermano` (`idHermano`),
  CONSTRAINT `tiene_ibfk_1` FOREIGN KEY (`idPostulante`) REFERENCES `postulante` (`idPostulante`),
  CONSTRAINT `tiene_ibfk_2` FOREIGN KEY (`idHermano`) REFERENCES `hermano` (`idHermano`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS tipodeie;

CREATE TABLE `tipodeie` (
  `idTipoIE` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idTipoIE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS tipoderesponsable;

CREATE TABLE `tipoderesponsable` (
  `idTipoResponsable` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idTipoResponsable`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS tipodevivienda;

CREATE TABLE `tipodevivienda` (
  `idTipoVivienda` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idTipoVivienda`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS tipofamilia;

CREATE TABLE `tipofamilia` (
  `idTipoFam` int(11) NOT NULL,
  `nombre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`idTipoFam`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS voucher;

CREATE TABLE `voucher` (
  `idVoucher` int(11) NOT NULL AUTO_INCREMENT,
  `numOperacion` int(11) DEFAULT NULL,
  `fechaPago` date DEFAULT NULL,
  `idPostulante` int(11) DEFAULT NULL,
  `imagen` longblob NOT NULL,
  PRIMARY KEY (`idVoucher`),
  KEY `idPostulante` (`idPostulante`),
  CONSTRAINT `voucher_ibfk_1` FOREIGN KEY (`idPostulante`) REFERENCES `postulante` (`idPostulante`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;

